$(document).ready(function(){
	// These window.navigator contain language information
	// 1. languages -> Array of preferred languages (eg ["en-US", "zh-CN", "ja-JP"]) Firefox^32, Chrome^32
	// 2. language  -> Preferred language as String (eg "en-US") Firefox^5, IE^11, Safari, 
	//                 Chrome sends Browser UI language
	// 3. browserLanguage -> UI Language of IE
	// 4. userLanguage    -> Language of Windows Regional Options
	// 5. systemLanguage  -> UI Language of Windows
	var browserLanguagePropertyKeys = ['languages', 'language', 'browserLanguage', 'userLanguage', 'systemLanguage'];

	var availableLanguages = ['en', 'vi'];

	var detectedLocale = _.chain(window.navigator)
	    .pick(browserLanguagePropertyKeys) //Get only language properties
	    .values() //Get values of the properties
	    .flatten() //flatten all arrays
	    .compact() //Remove undefined values
	    .map(function (x) {
	        return x.substr(0, 2); //Shorten strings to use two chars (en-US -> en)
	    })
	    .find(function (x) {
	        return _.includes(availableLanguages, x); //Returns first language matched in available languages
	    })
	    .value();

	var locale = detectedLocale || 'en'; //If no locale is detected, fallback to 'en';

	var title = locale == 'vi'? 'Người nổi tiếng đang làm gì trên mạng xã hội?': 'What celebrities are doing on Instagram?'; 
	
	$.getJSON('https://piknow.net/ajax?data=ads_banner&origin='+location.hostname, function(data){
		if ($('#piknowAds').length) {
			var _html = '';
				_html += 	'<h3 style="text-align: left;"><a href="'+data.account.url+'">'+title+'</a></h3>';
				_html += 	'<div class="media" style="text-align: left;">';
				_html += 		'<a href="'+data.account.url+'">';
				_html +=        	'<div class="media-left" style="margin-right: 10px; display: inline-block;">';
				_html +=            	'<img src="'+data.account.avatar+'" class="media-object" style="width:80px; height: 80px; border-radius: 50%;">';
				_html +=        	'</div>';
				_html +=        	'<div class="media-body" style="display: inline-block;">';
				_html +=            	'<h4>'+data.account.name+'</h4>';
				_html +=        		'<div>@'+data.account.username+'</div>';
				_html +=        	'</div>';
				_html +=        '</a>';
				_html +=    '</div>';
				_html += '<div class="row">';
			$.each(data.medias, function(i, item){
				_html += '<div class="col-sm-3">';
				_html +=    '<a href="'+item.url+'">';
				_html += 		'<img src="'+item.thumb+'" style="width: 100%; height: 280px; object-fit: cover;">';
				_html += 	'</a>';
				_html +=	'<div style="position: relative;">';
				_html +=		'<div style="position: absolute; bottom: 10px; left: 0; right: 0; padding: 0 4px; color: #FFF; background: #00000082;">';
				_html +=        	'<span>'+item.caption+'</span>';
				_html +=    	'</div>';
				_html +=    '</div>';
				_html +=    '<h5><a href="'+item.url+'">'+item.time+'</a>..</h5>';
				_html += '</div>';
			});
			_html += '</div>';
			$('#piknowAds').html(_html);
		}

		if ($('#piknowSideAds').length) {
			var _html = '';
				_html += 	'<h3 style="text-align: left;"><a href="'+data.account.url+'">'+title+'</a></h3>';
				_html += 	'<div class="media" style="text-align: left;">';
				_html += 		'<a href="'+data.account.url+'">';
				_html +=        	'<div class="media-left" style="margin-right: 10px; display: inline-block;">';
				_html +=            	'<img src="'+data.account.avatar+'" class="media-object" style="width:80px; height: 80px; border-radius: 50%;">';
				_html +=        	'</div>';
				_html +=        	'<div class="media-body" style="display: inline-block;">';
				_html +=            	'<h4>'+data.account.name+'</h4>';
				_html +=        		'<div>@'+data.account.username+'</div>';
				_html +=        	'</div>';
				_html +=        '</a>';
				_html +=    '</div>';
				_html += '<div class="row">';
			$.each(data.medias, function(i, item){
				_html += '<div class="col-sm-3 col-md-12">';
				_html +=    '<a href="'+item.url+'">';
				_html += 		'<img src="'+item.thumb+'" style="width: 100%; height: 280px; object-fit: cover;">';
				_html += 	'</a>';
				_html +=	'<div style="position: relative;">';
				_html +=		'<div style="position: absolute; bottom: 10px; left: 0; right: 0; padding: 0 4px; color: #FFF; background: #00000082;">';
				_html +=        	'<span>'+item.caption+'</span>';
				_html +=    	'</div>';
				_html +=    '</div>';
				_html +=    '<h5><a href="'+item.url+'">'+item.time+'</a>..</h5>';
				_html += '</div>';
			});
			_html += '</div>';
			$('#piknowSideAds').html(_html);
		}
	});
});